import React from "react";
import { Container } from "react-bootstrap";
import "./styles/reachMePageStyle.css";

function ReachMePage() {
  return (
    <div className="ReachMePage">
      <Container>
        <h1 className="ReachMePage-header">Reach Me!</h1>
        <div class="md-form mb-4 pink-textarea active-pink-textarea">
          <textarea
            id="form18"
            class="md-textarea form-control"
            rows="3"
          ></textarea>
          <label for="form18">Material textarea colorful on :focus state</label>
        </div>
      </Container>
    </div>
  );
}

export default ReachMePage;
